import React, { useEffect } from 'react';
import Logo from './Logo';
import Summary from './Summary';
import Certifications from './Certifications';
import Contact from './Contact';
import gsap from 'gsap';

function Home() {
  useEffect(() => {
    gsap.from('.summary-section', { opacity: 0, duration: 1, y: 50, stagger: 0.3 });
    gsap.from('.certifications-section', { opacity: 0, duration: 1, y: 50, stagger: 0.3 });
    gsap.from('.contact-section', { opacity: 0, duration: 1, y: 50, stagger: 0.3 });
  }, []);

  return (
    <div className="home">
      <main>
        <Summary />
        <Certifications />
        <Contact />
      </main>
    </div>
  );
}

export default Home;
